import React from 'react';
import styled from 'styled-components';

const NavContainer = styled.div`
display: flex;
height: 50px;
width: 100%;
background-color: ${props => props.theme.colors.primary};

img{
    display: block;
    mex
}

`

export const Navbar = props => {
    return(
        <NavContainer>
            <img src={'/personal_logo_free.png'}/>

        </NavContainer>
    )
}
